hitcher.viewModels=function(){var t=function(t){this.model=t,this.canDelete=t.isCurrentUserRoute,this.canChat=!t.isCurrentUserRoute,this.startName=t.startName,this.startTime=new Date(Date.parse(t.startTime)).toLocaleString(),this.dueDate=new Date(Date.parse(t.dueDate)).toLocaleString(),this.recurrencyInfo=t.recurrency?t.recurrency.recurrencyInfo:null,this.endName=t.endName,this.driver=t.name,this.userId=t.userId,this.phone=t.phone,this.distance=Math.floor(t.totalDistance/1e3)+" км, "+t.totalDistance%1e3+" м",this.duration=t.totalDuration.toString().toHHMMSS(),this.photoPath=t.photoPath};return{routeViewModel:t}}();